import phoneImage from '../../../../public/img/apple_13.jpg'

function BodyCart() {
   return (
      <div className="body__cart body-cart">
         <div className="body-cart__image">
            <img src={phoneImage} alt="iphone" />
         </div>
         <div className="body-cart__title">Пинск, 29 июня 21:16</div>
         <div className="body-cart__subtitle">IPHONE 13 PRO MAX</div>
      </div>
   )
}

export default BodyCart
